import React from 'react';
import logo from './logo.svg';
import './App.css';

const Job = (props) => {
  return (
    <div className="Job">
      <img className="CompanyLogo" src={logo} alt="Company Logo" />
      <h1>Salary: {props.salary}</h1>
      <h1>Position: {props.position}</h1>
      <h1>Company: {props.company}</h1>
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <Job salary={100000} position="Senior SDE" company="Facebook" />
      <Job salary={90000} position="Junior SDE" company="Google" />
      <Job salary={80000} position="Project Manager" company="Amazon" />
    </div>
  );
}

export default App;
